tooltipAction.customFunction:
var entityDatasource = widgetContext.mapInstance.datasources.filter(
    function(entity) {
        return entity.entityId === entityId.id
    });

widgetContext.mapInstance.saveMarkerLocation(entityDatasource[0], null, null).subscribe(function success() {
        widgetContext.updateAliases();
});

settings.cellStyleFunction:
var color;
if (value === "true") {
    color = 'rgb(39, 134, 34)';
} else {
    color = 'rgb(255, 0, 0)';
}
return {
    color: color,
    fontSize: '18px'
};

var color;
if (value === 1) {
    color = 'rgb(39, 134, 34)';
} else {
    color = 'rgb(255, 0, 0)';
}
return {
    color: color,
    fontSize: '18px'
};

settings.tooltipValueFormatter:
if (value > 0 && value <= 1) {
    return 'On';
} else if (value === 0) {
    return 'Off';
} else {
    return '';
}

yaxis.ticksFormatter:
if (value == 1) {
    return 'On';
} else if (value === 0) {
    return 'Off';
} else {
    return '';
}

