settings.rowStyleFunction:
var result = {}
if (rowData.EventName == "FACE_MATCHED") {
    result["border-radius"] = "10px";
    result.background =
        "linear-gradient(to left, rgba(124,252,0, 0.5) 0%, rgba(124,252,0, 0) 100%)";
}

return result

